# Definition for a binary tree node.
class TreeNode():
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

class Solution:
    def sumNumbers(self, root: TreeNode) -> int:

        def dfs(node):
            if not node:
                return []
            next_path = dfs(node.left) + dfs(node.right)
            if not next_path:
                cur_path = [str(node.val)]
            else:
                cur_path = [str(node.val) + v for v in next_path]
            return cur_path

        return sum([int(v) for v in dfs(root)])
