public boolean isSameTree(TreeNode p, TreeNode q) {
    // 两个节点都为空，返回true
    if (p == null && q == null) {
        return true;
    } 
    // 只有一个节点为空，返回false
    else if (p == null || q == null) {
        return false;
    } 
    // 两个节点的值不同，返回false
    else if (p.val != q.val) {
        return false;
    } 
    // 递归检查左子树和右子树
    else {
        return isSameTree(p.left, q.left) && isSameTree(p.right, q.right);
    }
}
