### 思路
- 字符串变成数组，对数组循环，以循环下标为基准切分左右为数组1和数组2，再算两边绝对距离
- 算法知识：迭代、循环、数组切分、绝对距离

### 代码
#### TypeScript实现
```ts
function shortestToChar(s: string, c: string): number[] {
    const sArr = s.split('')
    const reArr:number[] = []

    sArr.forEach((item, index) => {
      const cursor = item
      if (cursor == c) reArr[index] = 0
      else {
        const left = sArr.slice(0, index+1).reverse()
        const right = sArr.slice(index)

        const leftDistance = left.indexOf(c)
        const rightDistance = right.indexOf(c)

        if (leftDistance == -1) {
          reArr[index] = rightDistance
        } else if (rightDistance == -1) {
          reArr[index] = leftDistance
        } else {
          reArr[index] = leftDistance - rightDistance >= 0 ? rightDistance : leftDistance
        }
      }
    })

    return reArr
}
```
