class Solution:
    def shortestToChar(self, s: str, c: str) -> List[int]:
        N = len(s)
        result = [N]*N
        position = float('inf')
        for i in range(N):
            if s[i]==c:
                result[i] = 0
                position = i
            else:
                result[i] = abs(position - i)
        for i in range(N-1,-1,-1):
