class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        String[] split = Integer.toString(k).split("");
        LinkedList<Integer> list = new LinkedList<>();
        int nl = num.length - 1;
        int sl = split.length - 1;
        int ii = Math.max(nl, sl);
        int t = 0;
        for (int i = 0; i <= ii; i++) {
            int a = nl - i < 0 ? 0 : num[nl - i];
            int b = sl - i < 0 ? 0 : Integer.parseInt(split[sl - i]);
            int sum = a + b + t;
            int m = sum % 10;
            t = (sum - m) / 10;
