public static int[] shortestToChar2(String s, char c) {
    int[] in = new int[s.length()];
    // 上一个c的位置
    int l = -1;
    for (int i = 0; i < in.length; i++) {
        if (s.charAt(i) == c){
            if (l == -1){
                for (int j = l + 1; j < i; j++){
                    in[j] = i - j;
                }
            } else {
                for (int j = l + 1; j < i; j++){
                    in[j] = Math.min(j - l, i - j);
                }
            }
            l = i;
        }
    }
    if (l != in.length - 1){
        for (int i = 1; l + i < in.length; i++) {
            in[l + i] = i;
        }
    }
    return in;
}
