public static int maxChunksToSorted(int[] arr) {
        LinkedList<Integer> l = new LinkedList<>();
        for (int a : arr) {
            if (l.isEmpty() || a >= l.peek()){
                // 保留每个分段的最大值
                l.push(a);
            } else {
                // 取出当前分段最大值
                int max = l.pop();
                while (!l.isEmpty() && l.peek() > a){
                    // 右边的值小于左边分段最大值，合并分段
                    l.pop();
                }
                l.push(max);
            }
        }
        return l.size();
    }
