将链表首位相连，根据偏移量取旋转后的最后一位

## 代码

```java
public static ListNode rotateRight(ListNode head, int k) {
        if (head == null || head.next == null || k == 0){
            return head;
        }
        ListNode l = head;
        int max = 1;
        while (l.next != null){
            l = l.next;
            max++;
        }
        // 移动的次数
        int f = k % max;
        if (f == 0){
            return head;
        }
        // 首位相连
        l.next = head;
        ListNode end = head;
        // 获取旋转后的最后一位
        while (++f < max){
            end = end.next;
        }
        ListNode re = end.next;
        end.next = null;
        return re;
    }
```

## 复杂度

时间复杂度：O(n)

空间复杂度：O(1)

