#### Intuition
There would be nested pattern like `k_1[encoded_1 k_2 [encoded_2]]` so we can use stack to handle this question. We need decode the nested `k_2 [encoded_2]`, push the decoded string into the stack and concatenate it with `encoded_1`.

#### Algorithm
Traverse characters of given string and store them into a stack. When we get a "]", we need to calculate the intermediate decoded string by pop characters from the stack. Then we push the intermediate decoded string into the stack. And continue the traversal.

```python3
class Solution:
    def decodeString(self, s: str) -> str:
        stack = []
        for char in s:
            if ("0" <= char <= "9" or "a" <= char <= "z"): 
                stack.append(char)
            elif (char == "["): stack.append(char)
            elif (char == "]"): 
                k = ""
                encoded = ""
                while stack and stack[-1] != "[":
                    encoded = stack.pop() + encoded
                if stack and stack[-1] == "[": stack.pop()
                while stack and "0" <= stack[-1] <= "9":
                    k = stack.pop() + k
                intermediate = int(k) * encoded 
                stack.append(intermediate)
        return "".join(stack)
```

#### Complexity
Assuming that the length of given string is n and the length of decoded string is N
Time: O(n + N), 

Space: O(N)

#### Intuition
Assuming that there are k chunks $$c_1, c_2, ... c_k$$. For every two chunks $c_i$ and $c_(i+1),$ where $i  < k$, this rule exists: $max(c_i) <= min(c_(i+1))$. 

#### Algorithm
Traverse the array, use an increasing stack to store the current $max(c_i)$. When current element is less than the current $max(c_i)$, pop the stack to merge previous chunks until the top of the stack is not larger than the current element, which means we find the chunk that the current element belongs to. Then we push the $max(c_i)$ back for the above rule in the intuition.

```python3
class Solution:
    def maxChunksToSorted(self, arr: List[int]) -> int:
        stack = []
        for a in arr:
            if len(stack) == 0 or a >= stack[-1]:
                stack.append(a)
            else:
                current_max = stack.pop()
                while stack and stack[-1] > a:
                    stack.pop()
                stack.append(current_max)
        return len(stack)
```

#### Complexity
Assuming that `n` is the length of the input arrar
1. Time: O(n), 
2. Space: O(n)

