**_day1:_**:数组形式的整数加法
**思路：**
从num数组最后一位开始和k的最后一位开始相加，如果有进位的话（相加>10的时候），加到k上,，每位相加的和-10；如果最后k还有数值的话，就继续把k值的每一位放到返回的list中，最后反转list,因为放的时候是从数字的低位开始放的，需要变成从高位开始放。
**代码：**
```
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> res = new ArrayList<Integer>();
        int n = num.length;
        for (int i = n - 1; i >= 0; --i) {
            int sum = num[i] + k % 10;
            k /= 10;
            if (sum >= 10) {
                k++;
                sum -= 10;
            }
            res.add(sum);
        }
        
        while (k > 0) {
            res.add(k % 10);
            k /= 10;
        }
      
        Collections.reverse(res);
        return res;
    }
}
```
