## Approach
Using two stack implementing queue, stackOne doing push while stackTwo doing pop and peek, if two stacks are empty, then return empty

## Algorithm
```java
class MyQueue {

        private Stack <Integer> stackOne;
        private Stack <Integer> stackTwo;

    public MyQueue() {
        stackOne = new Stack<Integer>();
        stackTwo = new Stack<Integer>();
    }

    public void push(int x) {
        stackOne.push(x);   
    }

    public int pop() {
        if( stackTwo.isEmpty() ) {
            while ( ! stackOne.isEmpty() ) {
                stackTwo.push ( stackOne.pop() );
            }
        }
        return stackTwo.pop();
    }

    public int peek() {
        if ( stackTwo.isEmpty() ) {
            while( ! stackOne.isEmpty() ) {
                stackTwo.push( stackOne.pop() );
            }
        }
        return stackTwo.peek();

    }

    public boolean empty() {
        if ( stackOne.isEmpty() && stackTwo.isEmpty() ) {
            return true;
        } else{
            return false;
        }

    }
}
```
