## Approach
1. First create a dummy head before the real head of the linked list.
2. While the linked list isn't empty
3. Swap the node, make -1->2->1->3
4. Make the previous and head moving forward


## Algorithm
```java
/**
 * Definition for singly-linked list.
 * public class ListNode {
 *     int val;
 *     ListNode next;
 *     ListNode() {}
 *     ListNode(int val) { this.val = val; }
 *     ListNode(int val, ListNode next) { this.val = val; this.next = next; }
 * }
 */
class Solution {
    public ListNode swapPairs(ListNode head) {

        //make a pretend head, before the real head
        ListNode x = new ListNode(-1);
        x.next = head;
        ListNode previous = x;

        while(head != null && head.next != null){
            ListNode first = head;
            ListNode second = head.next;

            //swaping
            previous.next = second;
            first.next = second.next;
            second.next = first;

            // move the previous and head forward
            previous = first;
            head = first.next;
