        k = Math.floor(k / 10)
        const temp = plus + carry
        if (temp >= 10) {
            carry = 1
        } else {
            carry = 0
        }
        res.unshift(temp % 10)
    }
    if (carry) {
        res.unshift(carry)
    }
    return res
};
