/**
 * @param {string} s
 * @return {string}
 */
var decodeString = function(s) {
    // 括号匹配
    // 栈
    // 递归与迭代
    // https://leetcode-solution.cn/solutionDetail?type=3&id=4&max_id=2
    const stack = []
    const len = s.length
    for (let i = 0; i < len; i++) {
        if (s[i] === ']') {
            let repeatStr = ''
            let repeatNum = ''
            // 计算 repeatStr
            while (stack.length && stack[stack.length - 1] !== '[') {
                repeatStr = stack.pop() + repeatStr // 注意要从后面 +
            }
            // 遇到 '['
            stack.pop()
            // 计算 repeatNum
            while (stack.length && !isNaN(stack[stack.length - 1])) {
                repeatNum = stack.pop() + repeatNum // 注意要从后面 +
            }
            const res = repeatStr.repeat(Number(repeatNum))
            stack.push(res) // 将此次结果放在栈内
        } else {
            // 只要不为 ']'，就一直 push
            stack.push(s[i])
        }
    }
    return stack.join('')
};
