### 解法
1. 先遍历字符串找出c的所有索引值缓存至索引列表
2. 再遍历字符串计算每个索引到索引列表最小值得出结果
```java
class Solution {
    public int[] shortestToChar(String s, char c) {
        List<Integer> cIndex = new ArrayList<>();
        for (int i = 0; i < s.length(); i++) {
            char a = s.charAt(i);
            if (s.charAt(i) == c) {
                cIndex.add(i);
            }
        }

        int[] result = new int[s.length()];
        for (int i = 0; i < s.length(); i++) {
            int distance = Math.abs(i - cIndex.get(0));
            if (distance == 0) {
                result[i] = 0;
                continue;
            }
            for (int j = 1; j < cIndex.size(); j++) {
                int jd = cIndex.get(j);
                int currentDistance = Math.abs(i - jd);
                if (currentDistance < distance) {
                    distance = currentDistance;
                }
            }
            result[i] = distance;
        }

        return result;
    }
}
