class Solution {
    public int findBottomLeftValue(TreeNode root) {
        Deque<TreeNode> queue = new ArrayDeque<>();
        queue.add(root);
        TreeNode cur = null;
        while(!queue.isEmpty()){
            cur = queue.poll();
            // offer the right child node into the queue
            if(cur.right != null){queue.offer(cur.right);}
            if(cur.left != null){ queue.offer(cur.left);}
        }
        return cur.val;
    }
}

```

