- 空间复杂度：O(N) the number of node in last level is approximately N/2

### Method 2
DFS preorder traversal. Find out the first occurrence of node with the longest path from the root node. 
Recursive order guarantees the leftmost node of the bottom level could be visited firstly. 

### Code

```java
class Solution {
    private TreeNode ans = null;
    public int findBottomLeftValue(TreeNode root) {
        dfs(root, 0, new int[]{Integer.MIN_VALUE});
        return ans.val;
    }
    private void dfs(TreeNode root, int len, int[] maxlen){
        if(root == null){
            return;
        }
        if(len> maxlen[0]){
            ans = root;
            maxlen[0] = len;
        }
        dfs(root.left, len+1, maxlen);
        dfs(root.right, len+1, maxlen);
    }
}
```

